import React, { useState } from 'react';
import axios from 'axios';

function PostProfile() {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    speed: '',
    pop_name: '',
    Dslam_hostname: '',
    Frame: '',
    Attainable_speed: '',
  });

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axios.post('https://randomuser.me/api/?results=12', formData);
      console.log('Post successful:', response.data);
      // You can perform any additional actions after successful post
    } catch (error) {
      console.error('Error posting data:', error);
    }
  };

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  return (
    <div>
      <h2>Post Profile</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleInputChange} />
        </div>
        <div>
          <label>Phone:</label>
          <input type="text" name="phone" value={formData.phone} onChange={handleInputChange} />
        </div>
        <div>
          <label>Speed:</label>
          <input type="text" name="speed" value={formData.speed} onChange={handleInputChange} />
        </div>
        <div>
          <label>POP Name:</label>
          <input type="text" name="pop_name" value={formData.pop_name} onChange={handleInputChange} />
        </div>
        <div>
          <label>DSLAM Hostname:</label>
          <input type="text" name="Dslam_hostname" value={formData.Dslam_hostname} onChange={handleInputChange} />
        </div>
        <div>
          <label>Frame:</label>
          <input type="text" name="Frame" value={formData.Frame} onChange={handleInputChange} />
        </div>
        <div>
          <label>Attainable Speed:</label>
          <input type="text" name="Attainable_speed" value={formData.Attainable_speed} onChange={handleInputChange} />
        </div>
        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
  );
}

export default PostProfile;
